import { createContext, useContext, useState } from "react";

const PrivateKeyContext = createContext();

export const PrivateKeyProvider = ({ children }) => {
    const [privateKey, setPrivateKey] = useState(null);

    return (
        <PrivateKeyContext.Provider value={{ privateKey, setPrivateKey }}>
            {children}
        </PrivateKeyContext.Provider>
    );
};

export const usePrivateKey = () => useContext(PrivateKeyContext);
